import CinemaCard from './CinemaCard.jsx';
import React, { useState } from "react";
import DatePickerComponent from './DatePickerComponent.jsx';

const sede1 = {
    sede: 'CineAgile Trujillo',
    funciones: [
        {
            dimension: "2D",
            categoria: "Premium",
            horaInicio: "4:00 pm",
            sala: 1,
            precio: 1000,
        },
        {
            dimension: "2D",
            categoria: "Premium",
            horaInicio: "4:30 pm",
            sala: 1,
            precio: 1000,
        },
        {
            dimension: "2D",
            categoria: "Premium",
            horaInicio: "5:30 pm",
            sala: 1,
            precio: 1000,
        }
    ]
}
const sede2 = {
    sede: 'CineAgile Lima',
    funciones: [
        {
            dimension: "2D",
            categoria: "Premium",
            horaInicio: "5:00 pm",
            sala: 1,
            precio: 1000,
        },
        {
            dimension: "3D",
            categoria: "Regular",
            horaInicio: "5:30 pm",
            sala: 1,
            precio: 1000,
        },
        {
            dimension: "3D",
            categoria: "Regular",
            horaInicio: "6:30 pm",
            sala: 1,
            precio: 1000,
        }
    ]
}
const sede3 = {
    sede: 'CineAgile Chiclayo',
    funciones: [
        {
            dimension: "3D",
            categoria: "Regular",
            horaInicio: "6:00 pm",
            sala: 1,
            precio: 1000,
        },
        {
            dimension: "3D",
            categoria: "Regular",
            horaInicio: "5:30 pm",
            sala: 1,
            precio: 1000,
        },
        {
            dimension: "3D",
            categoria: "Regular",
            horaInicio: "6:30 pm",
            sala: 1,
            precio: 1000,
        }
    ]
}
function App() {
    return (
        <div className="App p-4">
            <div className="mx-3 d-flex justify-content-between">
                <div>
                    <h4>Pelicula</h4>
                    <h4>Star Wars capitulo 3</h4>
                </div>
                <DatePickerComponent></DatePickerComponent>

            </div>
            <CinemaCard sede={sede1.sede} funciones={sede1.funciones}></CinemaCard>
            <CinemaCard sede={sede2.sede} funciones={sede2.funciones}></CinemaCard>
            <CinemaCard sede={sede3.sede} funciones={sede3.funciones}></CinemaCard>
        </div>
    );
}
export default App;
